import React from "react";

const Timeline = props => {
  let chirps = this.props.chirps.map(chirp => {
    return (
      <div className="container">
        <p>Chirp ID: {chirp.chirpId}</p>
        <p>{chirp.chirpContent}</p>
      </div>
    );
  });
  return chirps;
};

export default Timeline;
